import { emptyChatImage } from "../../Constants/data";
import {Box, Typography,styled} from "@mui/material";


const Component=styled(Box)`
background:#f8f9fa;
padding:30px 0;
`

const EmptyChat=()=>{


    return(
        <Box>
            <Box>
                <img src={emptyChatImage} alt="image"/>
                <Typography>WhatsApp Web</Typography>
                <Typography>Now send and receive messsages without keeping your phone online.</Typography>
                <Typography>Use WhatsApp on up to 4 linked devices and 1 phone at the same time.</Typography>
            </Box>
        </Box>
        )
}
export default EmptyChat;
